Anna Sergeyevna Kournikova (born June 7, 1981) is a semi-retired Russian professional tennis player and model. Her celebrity made her one of the best known tennis players worldwide. At the peak of her fame, fans looking for images of Kournikova made her name (or misspellings of it) one of the most common search strings on the internet search engine Google.
